package com.coding.challenge.sliding.window;

import java.util.HashMap;
import java.util.Map;

class MinWindowSubstr {
	MinWindowSubstr() {
		throw new AssertionError();
	}

	public static void main(String[] args) {
		assert "BANC".equals(minWindow("ADOBECODEBANC", "ABC"));

		assert "a".equals(minWindow("a", "a"));

		assert "".equals(minWindow("a", "aa"));

		assert "ba".equals(minWindow("bba", "ab"));

		assert "cwae".equals(minWindow("cabwefgewcwaefgcf", "cae"));

		assert "b".equals(minWindow("ab", "b"));

		assert "aa".equals(minWindow("aa", "aa"));

		final String s = "";
		final String t = "";
		final String exp = "";
		assert exp.equals(minWindow(s, t));
	}

	static String minWindow(String s, String t) {
		final int n = s.length();
		// use of auxiliary data structures
		final Map<Character, Integer> tm = new HashMap<>();

		// initializing tables
		for (char ch : t.toCharArray())
			tm.merge(ch, 1, Integer::sum);

		final int distCharCnt = tm.size();
		// window bounds
		int i = 0;
		int j = n;
		final Map<Character, Integer> wm = new HashMap<>();
		int c = 0;

		// loop-invariant: the window does not contain substring t. It's char count is
		// less than that of t.
		for (int k = 0, l = 0; l < n; l++) {
			final char ch = s.charAt(l);
			if (tm.containsKey(ch)) {
				wm.merge(ch, 1, Integer::sum);
				if (tm.get(ch).equals(wm.get(ch))) {
					c = c + 1;
					while (c == distCharCnt) {
						if (tm.containsKey(s.charAt(k))) {
							if (j - i > l - k) {
								i = k;
								j = l;
							}
							// slide the lower end of the window by one more element.
							wm.put(s.charAt(k), wm.get(s.charAt(k)) - 1);
							if (wm.get(s.charAt(k)) < tm.get(s.charAt(k)))
								c = c - 1;
						}
						k = k + 1;
					}
				}
			}
		}
		// no such substring.
		if (j == n)
			return "";

		return s.substring(i, j + 1);
	}
}
